@bersbersbers yes, it was reverted.
The issue is that the change to always use the `EuclideanNorm` op from within `tf.norm` breaks many workflows that rely on the existing `norm` function, since it introduces a new op that isn't supported on all devices.
The only workable solution is that if you *need* the higher accuracy, then use `tf.math.reduce_euclidean_norm` directly. Internally, it uses a more stable way of computing the norm that less prone to overflow and precision issues.

